script: |
  super -f text -I q5195.spq | sort > q5195.out

inputs:
  - name: q5195.spq
    data: |
      SELECT - + col1 col2, - 13 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT IN ( - ( CAST ( + col1 AS INTEGER ) ), + 4 / + + col2 + col1, - col1, - col1 + 71 + - 51 - + ( - CAST ( ( + col1 ) AS INTEGER ) ) ) OR NOT NULL IS NULL;
  - name: tab0

outputs:
  - name: q5195.out
    data: |
